import React from 'react'
import Todo from './todo';

function Todos(props) {
    console.log(props.todos);
  return (
    <div>
       {props.todos.map((todo, index)=>(
        <Todo todo={todo} />
       ))}
    </div>
  )
}

export default Todos;
